import React from "react";

function recur(listitem){
  return <div className="itemColumn">{listitem.map((item, index) => (<div key={index}> {Array.isArray(item) ?  
    recur(item): item}{item}</div>))}</div>
}

// export a home page component
export default class Items extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        listitems: ["sa", ["b1", ["b2", "b3"], "b4"], "c"]
    };
  }

  render() {
    return (
        <div className="listitem">
        {this.state.listitems.map((listitem, index) => (
          <div className="item" key={index}>
            {Array.isArray(listitem) ?  
                    recur(listitem): listitem}
          </div>
        ))}
      </div>
        );
  }
}
